import React from "react";
import { Wrapper, Card, Templetes } from "./style";

import logo from '../../images/logo.svg'

export default function Home() {
    return (
    <Wrapper>
         <img src={logo} alt="logo"/>
         <Card>
             <h2> Selecione um template</h2>
             <Templetes></Templetes>
         </Card>
    </Wrapper>
    );
}
